import React from 'react';
import './OurPlantationsSection.css';

function OurPlantationsSection() {
  return (
    <div className="plantations-section">
      <h2>OUR PLANTATIONS</h2>
      <p className="plantations-description">
        Browns Plantations is a unique synergy of three leading Sri Lankan plantation companies, uniting over 32 hectares of lush estates. Our plantations cultivate a diverse range of products, upholding a legacy of quality, sustainability, and innovation. We are committed to responsible stewardship, supporting our communities, and delivering the finest Ceylon tea to the world.
      </p>
      <button className="discover-btn">DISCOVER MORE</button>
    </div>
  );
}

export default OurPlantationsSection;
